  REMOVE_HTML_TAG_ELEMENT: 'REMOVE_HTML_TAG_ELEMENT',
  CHANGE_DELETE_SPEED: 'CHANGE_DELETE_SPEED',
  CHANGE_DELAY: 'CHANGE_DELAY',
  CHANGE_CURSOR: 'CHANGE_CURSOR',
  PASTE_STRING: 'PASTE_STRING',
